import React, { useState } from 'react';
import PostCard from '../components/PostCard';

const ListPage = () => {
  const [posts, setPosts] = useState([
    { id: 1, title: 'content1' },
    { id: 2, title: 'content2' },
    { id: 3, title: 'content3' },
    { id: 4, title: 'content4' },
    { id: 5, title: 'content5' },
    { id: 6, title: 'content6' },
  ]);
  return (
    <div>
      <h1>리스트 페이지</h1>
      <hr />
      {posts.map((post) => (
        <PostCard post={post} />
      ))}
    </div>
  );
};

export default ListPage;
